import { css } from "@emotion/core";
import { Box, Grid, Paper, Table, TableCell, TableRow, Typography } from "@material-ui/core";
import Skeleton from "@material-ui/lab/Skeleton";
import React from "react";

const container = css`
    width: 100%;
`;

const header = css`
    width: 100%;
    margin-bottom: 80px;
`;

const search = css`
    display: flex;
    justify-content: flex-end;
    margin-bottom: 16px;
`;

const buttons = css`
    display: flex;
    justify-content: flex-end;
    margin: 16px auto;

    span:first-child {
        margin-right: 16px;
    }
`;

const table = css`
    width: 60%;
    margin: auto;
`;

const AppSkeleton = () => {
    const renderCell = () => (
        <TableCell>
            <Skeleton variant="rect" height={20} />
        </TableCell>
    );

    const renderRow = () => (
        <TableRow>
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
            {renderCell()}
        </TableRow>
    );

    return (
        <div css={container}>
            <div css={header}>
                <Skeleton variant="rect" height={50} />
            </div>
            <div css={table}>
                <div css={search}>
                    <Skeleton variant="rect" width={200} height={30} />
                </div>
                <Table component={Paper} elevation={2} variant="outlined">
                    {renderRow()}
                    {renderRow()}
                    {renderRow()}
                    {renderRow()}
                    {renderRow()}
                    {renderRow()}
                </Table>
                <div css={buttons}>
                    <Skeleton variant="rect" width={120} height={30} />
                    <Skeleton variant="rect" width={120} height={30} />
                </div>
            </div>
        </div>
    );
};

export default AppSkeleton;
